import React, { useEffect, memo } from 'react';
import { useQuery } from '@apollo/client';
import TestQueries from 'graphql/queries/Test';
import styled from 'styled-components';

import Theme from 'app/assets/theme';
import LoadingIndicator from 'app/views/components/common/LoadingIndicator';
import { Grid } from '@material-ui/core';

const Wrapper = styled(Grid)``;

const Leaderboard = React.lazy(() => import('./Leaderboard'));
const ResultDetails = React.lazy(() => import('./ResultDetails'));
const FeaturedTests = React.lazy(() => import('app/views/pages/LandingPage/components/PhotoList'));

const ResultPage = props => {
	const { history, dispatch } = props;

	const resultId = props.match.params.resultId;
	const resultRes = useQuery(TestQueries.GET_READING_RESULT, {
		variables: { resultId: resultId },
	});
	const leaderboardRes = useQuery(TestQueries.GET_READING_LEADERBOARD_BY_RESULT_ID, {
		variables: {
			resultId: resultId,
			limit: 10,
			offset: 0,
			orderBy: 'descending',
		},
	});

	return (
		<Wrapper container justify="space-evenly" spacing={8}>
			<Grid item xs={12} lg={7}>
				<React.Suspense fallback={<LoadingIndicator hasSpacing />}>
					<ResultDetails resultRes={resultRes} history={history}></ResultDetails>
				</React.Suspense>
				<React.Suspense fallback={<LoadingIndicator hasSpacing />}>
					<FeaturedTests wrapperStyle={{ marginTop: '30px' }} lowPadding></FeaturedTests>
				</React.Suspense>
			</Grid>
			<Grid item xs={12} lg={3}>
				<React.Suspense fallback={<LoadingIndicator hasSpacing />}>
					<Leaderboard leaderboardRes={leaderboardRes}></Leaderboard>
				</React.Suspense>
			</Grid>
		</Wrapper>
	);
};

export default memo(ResultPage);
